            throw new Error('Invalid internal intent ' + intent);

        if (intent.isNeverMind)
            return "never mind";
        if (intent.isHelp)
            return "help";
        if (intent.isMake)
            return "make a command";
        if (intent.isHello)
            return "hello";
        if (intent.isCool)
            return "this is cool";
        if (intent.isThankYou)
            return "thank you";
        if (intent.isSorry)
            return "i'm sorry";
